rating \"9\" and review \"Very good! make me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Muscle Mastery\"\r\n    Then Tell the client that they need to complete the program first\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client entered a non-numerical value for rating\r\n    When Client \"eyas\" gave a rating \"good!\" and review \"Very good! make me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Weight Loss Advanced\"\r\n    Then Tell the client that the rating should be a numerical value\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client entered a value for rating outside the acceptable range\r\n    When Client \"eyas\" gave a rating \"-52\" and review \"VERY VERY BAD! MADE ME GAIN WEIGHT!\" and suggestion \"DO NOT FALL FOR THIS SCAM\" for program \"Weight Loss Advanced\"\r\n    Then Tell the client that the rating should be within the acceptable range\r\n    Then send client to \"write a review\"\r\n\r\n  Scenario: Client gave a bad rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"1\" and review \"it's bad! didn't lose weight at all!\" and suggestion \"Time per session is too little! More session time can save the program.\" for program \"Weight Loss Advanced\"\r\n    Then Apologize to the client and assure them that their suggestion will be considered\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave an okay rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"5\" and review \"it's okay! didn't lose much weight though!\" and suggestion \"Needs more times per session!\" for program \"Weight Loss Advanced\"\r\n    Then Thank the client for the their review and say that you'll try to fix the problem\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave a good rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"9\" and review \"Very good! made me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Weight Loss Advanced\"\r\n    Then Thank the client for the their liking of the program and the suggestion\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client chose to go back or entered an invalid input format\r\n    When Client \"eyas\" entered \"go back\"\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: return file;\r\n    Then returnfiles;","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/Eyas\/IdeaProjects\/EyasAdamProject\/src\/Features\/ClientFeatures\/ClientCompletedProgramsRating.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Client program rating and reviewing","description":"  Giving Clients the ability to rate and write reviews for programs that they already have completed...","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario","name":"Client tried to review a program that they did not complete","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"When ","keywordType":"Action","text":"Client \"eyas\" gave a rating \"9\" and review \"Very good! make me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Muscle Mastery\"","id":"376b7c75-da37-453f-b8e9-c8fe5f0b3cc6"},{"location":{"line":6,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Tell the client that they need to complete the program first","id":"3c9484ae-456e-4e8c-988b-547efaa9a103"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"send client to \"write a review\"","id":"96d0013a-f847-451a-8e65-2e1bcc6f35cc"}],"examples":[],"id":"9964bff0-db46-4734-a1cd-00e270463be2"}},{"scenario":{"location":{"line":9,"column":3},"tags":[],"keyword":                          |\r\n      | 4          | 40       | 1        |  invalid type                                      |\r\n      | 0          | 62       | 2        |  invalid type                                      |\r\n      | -1         | 40       | 1        |  invalid type                                      |\r\n      | fff        | 40       | 1        |  invalid type                                      |\r\n      | 1          | -10      | 4        |  invalid data must be a positive number            |\r\n      | 2          | -20      | 5        |  invalid data must be a positive number            |\r\n      | 1          | bb       | 4        |  invalid data must be a positive number            |\r\n      | 3          | -20      | 1        |  invalid data must be between 0 and 100            |\r\n      | 3          | 150      | 5        |  invalid data must be between 0 and 100            |\r\n      | 3          | vv       | 5        |  invalid data must be between 0 and 100            |\r\n      | vv         | -40      | 1        |  invalid type                                      |\r\n\r\n  Scenario: return file;\r\n    Then returnfiles;","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/Eyas\/IdeaProjects\/EyasAdamProject\/src\/Features\/InstructorFeatures\/Edit-The-Progress-Of-A-Client.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Edit the progress of a client","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[],"keyword":"Scenario Outline","name":"Edit progress data of a client successfully","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"the type of the edited value is \"<toEditType>\"","id":"2dd92534-6294-491f-98b8-5594fc560e18"},{"location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"the new value is \"<NewValue>\ And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | no notification |\r\n      | 6      | no notification |\r\n      | 7      | no notification |\r\n      | 8      | no notification |\r\n      | 9      | no notification |\r\n      | 10     | no notification |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program2\" about an update\r\n  Scenario Outline: Notify clients about updates to program2\r\n    Given I have an \"update\" in program \"program2\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | no notification |\r\n      | 9      | no notification |\r\n      | 10     | no notification |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program3\" about a removal\r\n  Scenario Outline: Notify clients about removals from program3\r\n    Given I have an \"remove\" in program \"program3\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\
